import React, { useEffect, useState } from 'react';
import axios from 'axios';
import './Dashboard.css';

const Dashboard = () => {
  const [user, setUser] = useState({});
  const [recentForms, setRecentForms] = useState([]);
  const [responseSummary, setResponseSummary] = useState([]);

  useEffect(() => {
    // Fetch user data
    const fetchUserData = async () => {
      try {
        // Assume you're fetching user info from an API
        const response = await axios.get('/api/user/profile');
        setUser(response.data);
      } catch (error) {
        console.error('Error fetching user data:', error);
      }
    };

    // Fetch recent forms
    const fetchRecentForms = async () => {
      try {
        const response = await axios.get('/api/forms/recent');
        setRecentForms(response.data);
      } catch (error) {
        console.error('Error fetching recent forms:', error);
      }
    };

    // Fetch response summary
    const fetchResponseSummary = async () => {
      try {
        const response = await axios.get('/api/forms/responses');
        setResponseSummary(response.data);
      } catch (error) {
        console.error('Error fetching response summary:', error);
      }
    };

    fetchUserData();
    fetchRecentForms();
    fetchResponseSummary();
  }, []);

  return (
    <div className="dashboard-container">
      {/* User Overview */}
      <div className="user-overview">
        <h2>Welcome, {user.name}</h2>
        <p>Email: {user.email}</p>
        <p>Account Created: {new Date(user.createdAt).toLocaleDateString()}</p>
      </div>

      {/* Recent Forms */}
      <div className="recent-forms">
        <h3>Recent Forms</h3>
        <ul>
          {recentForms.length > 0 ? recentForms.map(form => (
            <li key={form._id}>
              <h4>{form.title}</h4>
              <p>{form.description}</p>
            </li>
          )) : <p>No recent forms available.</p>}
        </ul>
      </div>

      {/* Response Summary */}
      <div className="response-summary">
        <h3>Response Summary</h3>
        <ul>
          {responseSummary.length > 0 ? responseSummary.map(summary => (
            <li key={summary.formId}>
              <h4>{summary.formTitle}</h4>
              <p>Total Responses: {summary.responseCount}</p>
            </li>
          )) : <p>No response data available.</p>}
        </ul>
      </div>

      {/* Settings */}
      <div className="settings">
        <h3>Settings</h3>
        <button className="settings-btn">Account Settings</button>
        <button className="settings-btn">Privacy Settings</button>
      </div>
    </div>
  );
};

export default Dashboard;
